+ (void)drawPlayingIndicatorWithFrame: (NSRect)frame;
{

    //// Rectangle Drawing
    NSBezierPath* rectanglePath = [NSBezierPath bezierPathWithRect: NSMakeRect(NSMinX(frame), NSMinY(frame), NSWidth(frame), NSHeight(frame))];
    [StreamCloudStyles.orangeGradient drawInBezierPath: rectanglePath angle: 90];
}

+ (void)drawSeperatorViewWithFrame: (NSRect)frame;
{
    //// Color Declarations
    NSColor* seperatorColor = [NSColor colorWithCalibratedRed: 0.773 green: 0.773 blue: 0.773 alpha: 1];

    //// Rectangle Drawing
    NSBezierPath* rectanglePath = [NSBezierPath bezierPathWithRect: NSMakeRect(NSMinX(frame), NSMinY(frame), NSWidth(frame), NSHeight(frame))];
    [seperatorColor setFill];
    [rectanglePath fill];
}

#pragma mark Generated Images

+ (NSImage*)imageOfPlayPauseButtonWithFrame: (NSRect)frame playing: (BOOL)playing;
{
    NSImage* imageOfPlayPauseButton = [NSImage.alloc initWithSize: NSMakeSize(48, 48)];
    [imageOfPlayPauseButton lockFocus];
    [StreamCloudStyles drawPlayPauseButtonWithFrame: frame playing: playing];
    [imageOfPlayPauseButton unlockFocus];

    return imageOfPlayPauseButton;
}

+ (NSImage*)imageOfShuffleButtonWithFrame: (NSRect)frame active: (BOOL)active;
{
    NSImage* imageOfShuffleButton = [NSImage.alloc initWithSize: NSMakeSize(32, 28)];
    [imageOfShuffleButton lockFocus];
    [StreamCloudStyles drawShuffleButtonWithFrame: frame active: active];
    [imageOfShuffleButton unlockFocus];

    return imageOfShuffleButton;
}

+ (NSImage*)imageOfRepeatButtonWithFrame: (NSRect)frame active: (BOOL)active;
