    NSImage* imageOfRepeatButton = [NSImage.alloc initWithSize: NSMakeSize(32, 30)];
    [imageOfRepeatButton lockFocus];
    [StreamCloudStyles drawRepeatButtonWithFrame: frame active: active];
    [imageOfRepeatButton unlockFocus];

